import React from "react";

const HomeContainer = () => {
  return (
    <div>
      <h1>Home</h1>
      <div className="home-container">
        <div className="details-container">
          <h2>Title/Mission</h2>
          <p>description here</p>
        </div>
      </div>
    </div>
  );
};

export default HomeContainer;
